import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">       
          <CommentDetail author="Sam" timeAgo="Today at 4:45PM" postNote="Nice blog post1" fakerImage={faker.image.avatar()}/>
          <CommentDetail author="Alex" timeAgo="Today at 2:00AM" postNote="Nice blog post2" fakerImage={faker.image.avatar()}/>
          <CommentDetail author="Jane" timeAgo="Yesterday at 5:00PM" postNote="Nice blog post3" fakerImage={faker.image.avatar()}/>
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'))
